import GoogleMapReact from 'google-map-react';
import React from 'react';

import classes from './Map.module.scss';

type LocationBlockProps = {
  mapLocation: number
}

const Map: React.FC<LocationBlockProps> = ({ mapLocation }) => {
  const AnyReactComponent = ({ text: string }) => (
    <div className={classes.Marker}>{text}</div>
  );
  const mapOptions = {
    center: {
      lat: mapLocation.lat,
      lng: mapLocation.lng,
    },
    zoom: 15,
  };

  return (
    <div id="google__map" className={classes.Map}>
      <GoogleMapReact center={mapOptions.center} zoom={mapOptions.zoom}>
        <AnyReactComponent lat={mapLocation.lat} lng={mapLocation.lng} />
      </GoogleMapReact>
    </div>
  );
};

export default Map;
